import MainPage from "components/MainPage"
import Docs from "components/Docs"
import { useState } from "react"

export default function App(){
    const [page, setPage] = useState(0)
    
    if (page === 0)
        return(
            <div>
                <MainPage />
            </div>
        )
    else return (
        <div>
            <Docs />
        </div>
    )
}
